import React, { Component } from 'react';
import styleGlasses from "./Glasses.module.css"
class Glasses extends Component {
  render() {
    return <div className={styleGlasses.glasses}>
      <button>
        <img src="" alt="" />
      </button>
    </div>;
  }
}

export default Glasses;
